import React,{useState} from 'react'
import './Content.css'
export default function Content() {
     let [Data,setData] = useState([])
     function Fun(){
      fetch(
        `https://www.googleapis.com/youtube/v3/search?&q=Guitar&part=snippet&maxResults=50&key=AIzaSyDHM9NhBsTWOyz-x41GNQ8jmcSiRVNAPYg&type=video`
      )
        .then((Response)=>{
          return Response.json();
    })
    .then((Data) =>{
      // console.log(Data.items[0].snippet)
      setData(Data.items)
    })
        
        
    }
  return (
    <div id='Content'>
      <center>
      {
        Data.map((e)=>
        (
          <div id='Video'>
        <h4 id='Title'>{e.snippet.title}</h4>
        {/* <img id='Thumbnails' src={e.snippet.thumbnails.high.urls}/> */}
        <p id='Channel'></p>
       </div>
        ))
      }
       
       <hr/>
       <button onClick={()=>{Fun()}}>Click</button>

       </center>




    </div>
  )
}
